  const categories = useApiFetch("http://localhost:5000/api/category/all");
  console.log(categories);
  const categoryList = categories[0]
    ? categories[0].map((category) => {
        return <li>{category.name}</li>;
      })
    : "";
  return <ul>{categoryList}</ul>;
}
